import React from 'react';
import DocUpload from './DocUpload';
import AdminNav from '../../layout/AdminNav';
import RealAdminNav from '../../layout/RealAdminNav';
import Sidebar from '../../components/Sidebar/SideBars';
import AdminCreatePerson from './AdminCreatePerson';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

const AdminDashboard= () => {
    return (
        <div>
        <RealAdminNav />
        <Router>
        <Sidebar />
      <Switch>
        <Route path="/admin/dashboard" exact component= {AdminCreatePerson} />
        <Route path="/admin/C" exact component= {AdminCreatePerson} />
        
      </Switch>
    </Router>
        </div>
    )
}

export default AdminDashboard
